import React from 'react';

const CotacoesAtuais: React.FC = () => {
    // Dados fixos para as ações
    const melhoresAcoesDoAno = [
        { symbol: 'AAPL', price: '150.00' },
        { symbol: 'MSFT', price: '300.00' },
        { symbol: 'TSLA', price: '700.00' },
    ];

    const pioresAcoesDoAno = [
        { symbol: 'XYZ', price: '10.00' },
        { symbol: 'ABC', price: '20.00' },
        { symbol: 'DEF', price: '5.00' },
    ];

    const acoesDaSemana = [
        { symbol: 'GOOGL', price: '200.00' },
        { symbol: 'AMZN', price: '320.00' },
        { symbol: 'NFLX', price: '600.00' },
    ];

    return (
        <div style={{ padding: '20px', textAlign: 'center' }}>
            <h1>Cotações Atuais</h1>
            <div style={{ display: 'flex', justifyContent: 'space-around', marginTop: '20px' }}>
                <div>
                    <h2>Melhores Ações do Ano</h2>
                    <ul>
                        {melhoresAcoesDoAno.map((acao, index) => (
                            <li key={index}>
                                {acao.symbol}: ${acao.price}
                            </li>
                        ))}
                    </ul>
                </div>
                <div>
                    <h2>Piores Ações do Ano</h2>
                    <ul>
                        {pioresAcoesDoAno.map((acao, index) => (
                            <li key={index}>
                                {acao.symbol}: ${acao.price}
                            </li>
                        ))}
                    </ul>
                </div>
                <div>
                    <h2>Ações da Semana</h2>
                    <ul>
                        {acoesDaSemana.map((acao, index) => (
                            <li key={index}>
                                {acao.symbol}: ${acao.price}
                            </li>
                        ))}
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default CotacoesAtuais;
